INSERT INTO `elementos` (`id`, `conteudo`, `tipo_elemento`, `valor`, `atributos`, `grupo`, `datacriacao`, `datamodificacao`, `ordem`) VALUES
(133, 61, 8, 'GUITAROSOFIA', NULL, NULL, '2009-09-10 06:00:46', '2009-09-10 09:16:28', NULL),
(134, 61, 7, '2009-08-18 00:00:00', NULL, NULL, '2009-09-10 06:00:46', '2009-09-10 09:16:28', NULL),
(135, 61, 17, 'Marcelo Barbosa lan&ccedil;a s&eacute;rie de aulas no Youtube. Confira.', NULL, NULL, '2009-09-10 06:00:46', '2009-09-10 09:16:28', NULL),
(136, 61, 9, '<p>\r\n	&nbsp;</p>\r\n<table bgcolor="#ffffff" border="1" cellspacing="0">\r\n	<caption>\r\n		<b>novidades</b></caption>\r\n	<thead>\r\n		<tr>\r\n			<th bgcolor="#c0c0c0" bordercolor="#000000">\r\n				<font color="#000000" face="Arial" style="font-size: 10pt;">texto</font></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr valign="TOP">\r\n			<td bordercolor="#c0c0c0">\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;"><img align="left" border="0" hspace="2" src="http://www.gtr.com.br/adminsetup/admin_img/imagens/origem/766_img.jpg" vspace="2" />Marcelo Barbosa acaba de disponibilizar no Youtube os primeiros videos da s&eacute;rie <strong>GUITAROSOFIA</strong>.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;">Tal s&eacute;rie &eacute; composta de pequenos videos, onde o guitarrista atrav&eacute;s de um bate papo informal, aborda diversos aspectos da guitarra, teoria musical, composi&ccedil;&atilde;o, improvisa&ccedil;&atilde;o e afins.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;">O material tem qualidade profissional e &eacute; uma produ&ccedil;&atilde;o do <strong>GTR Intituto de Guitarra</strong> com o apoio das marcas Tagima, Elixir, Orange, NIG, IBOX e Santo Angelo.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;"><em>&quot;Tenho um grande amor e interesse pelo ensino da m&uacute;sica, mais especificamente da guitarra e esta &eacute; uma das formas que encontrei para ajudar os interessados em aprender um pouco mais sobre o mundo das seis cordas. &Eacute; uma prazer poder dividir um pouco mais do que aprendi e pesquisei em mais de vinte anos dedicados a este instrumento.&quot;</em> Afirma o m&uacute;sico.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;">Os videos est&atilde;o dispon&iacute;veis nos canais do Youtube do guitarrista e tamb&eacute;m do <strong>GTR</strong>.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;">Inscreva-se nos canais e receba avisos sobres as futuras postagens.</font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;"><a href="http://www.youtube.com/marcelogtr" target="_blank">www.youtube.com/marcelogtr</a><br />\r\n					<a href="http://www.youtube.com/institutogtr" target="_blank">www.youtube.com/institutogtr</a></font></p>\r\n				<p align="justify">\r\n					<font color="#000000" face="Arial" style="font-size: 10pt;">Marcelo Barbosa &eacute; guitarrista das bandas <strong>Almah</strong> e <strong>khallice</strong> e diretor do <strong>GTR Instituto de Guitarra</strong>.</font></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n	<tfoot>\r\n	</tfoot>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<table bgcolor="#ffffff" border="1" cellspacing="0">\r\n</table>\r\n', NULL, NULL, '2009-09-10 06:00:46', '2009-09-10 09:16:28', NULL),
(137, 61, 19, '', NULL, NULL, '2009-09-10 06:00:46', '2009-09-10 09:16:28', NULL),
