(153, 65, 8, 'ALMAH: Marcelo Barbosa &eacute; o mais novo endorse da Orange', NULL, NULL, '2009-09-10 08:28:15', '2009-09-10 11:28:15', NULL),
(154, 65, 7, '2009-07-20 00:00:00', NULL, NULL, '2009-09-10 08:28:15', '2009-09-10 11:28:15', NULL),
(155, 65, 17, 'O guitarrista da banda ALMAH, Marcelo Barbosa, acabou de fechar um contrato...', NULL, NULL, '2009-09-10 08:28:15', '2009-09-10 11:28:15', NULL),
(156, 65, 9, '<p align="justify">\r\n	<img align="left" alt="" height="240" hspace="10" src="http://localhost/marcelobarbosa/files/images/755_news.jpg" vspace="" width="180" />O guitarrista da banda ALMAH, Marcelo Barbosa, acabou de fechar um contrato de endorse com a marca brit&acirc;nica de amplificadores Orange.</p>\r\n<p align="justify">\r\n	<font color="#000000" face="Arial" style="font-size: 10pt;">A marca &eacute; conhecida como uma das melhores do mundo e possui em seu time nomes como Tony Iommi (Black Sabbath), Gary Moore, AC/DC, Iced Earth, Jimmy Page (Led Zeppelin), Slipknot, dentre outros.</font></p>\r\n<p align="justify">\r\n	<font color="#000000" face="Arial" style="font-size: 10pt;">Marcelo Barbosa tamb&eacute;m faz parte do cast das marcas de guitarra Tagima, cabos Santo Angelo, pedais NIG, cordas Elixir e correias e acess&oacute;rios IBOX.</font></p>\r\n', NULL, NULL, '2009-09-10 08:28:15', '2009-09-10 11:28:15', NULL),
