(398, 119, 17, 'Estava postergando o momento de divulgar a minha agenda...', NULL, NULL, '2009-09-18 00:40:13', '2009-09-21 14:39:08', NULL),
(399, 119, 9, '<p>\r\n	Estava postergando o momento de divulgar a minha agenda da Expomusic deste ano para faze-lo quando ela estivesse o mais completa poss&iacute;vel. Ainda faltam os hor&aacute;rios dos workshops da NIG. De qualquer forma vou divulgar o que j&aacute; tenho e completo de hoje pra amanh&atilde; se der tudo certo.<br />\r\n	<br />\r\n	Decidi chegar em SP apenas na quinta este ano e por isso terei que sacrificar minha apresenta&ccedil;&atilde;o no Tagima Dream Team e os workshops de quarta. O fato &eacute; que estou com muito trabalho aqui em Bras&iacute;lia, tanto na escola quanto com o Zero10 e, como na segunda ap&oacute;s a Expo estarei embarcando para os EUA novamente, tenho que deixar tudo em ordem por aqui. <br />\r\n	<br />\r\n	A Expomusic &eacute; a maior feira de m&uacute;sica da Am&eacute;rica Latina e &eacute; sempre bom poder tocar e encontrar amigos e parceiros, alguns dos quais s&oacute; vejo nesta ocasiao. Vejo voc&ecirc;s l&aacute; ok?</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<b>Expo Music 2009<br />\r\n	</b><br />\r\n	<br />\r\n	Quinta, 24 &agrave;s 18:00 <br />\r\n	Frank Solari (Elixir) e Marcelo Barbosa <br />\r\n	Izzo (Elixir Strings)<br />\r\n	<br />\r\n	Quinta, 24 &agrave;s 19:10 <br />\r\n	Workshop<br />\r\n	Condor (Orange Amps)<br />\r\n	<br />\r\n	Sexta, 25 &agrave;s 16:50<br />\r\n	Workshop<br />\r\n	Condor (Orange Amps)<br />\r\n	<br />\r\n	Sexta, 25 &agrave;s 18:00<br />\r\n	Sess&atilde;o de Aut&ograve;grafos<br />\r\n	Santo Angelo<br />\r\n	<br />\r\n	Sexta, 25 &agrave;s 17:30 <br />\r\n	Workshop<br />\r\n	TAGIMA<br />\r\n	<br />\r\n	Sexta, 25 &agrave;s 19:00 <br />\r\n	Workshop<br />\r\n	Marcelo Barbosa (Elixir),Klaus Ximenes (SG),&nbsp; <br />\r\n	e Rodrigo Oliveira (Vic Firth).<br />\r\n	<br />\r\n	S&aacute;bado, 26 &agrave;s 15:10<br />\r\n	Workshop<br />\r\n	Condor (Orange Amps)<br />\r\n	<br />\r\n	S&aacute;bado, 26 &agrave;s 18:00<br />\r\n	Sess&atilde;o de aut&oacute;grafos<br />\r\n	Santo Angelo<br />\r\n	<br />\r\n	Domingo, 27 &agrave;s 16:00<br />\r\n	Sess&atilde;o de aut&oacute;grafos<br />\r\n	Santo Angelo<br />\r\n	<br />\r\n	Domingo, 27 &agrave;s 16:50<br />\r\n	Workshop<br />\r\n	Condor (Orange Amps)<br />\r\n	<br />\r\n	Domingo, 27 &agrave;s 18:15 <br />\r\n	Workshop<br />\r\n	TAGIMA</p>\r\n', NULL, NULL, '2009-09-18 00:40:13', '2009-09-21 14:39:08', NULL),
