(715, 251, 9, '<p>\r\n	Marcelo Barbosa e Almah concorrem da elei&ccedil;&atilde;o de Melhores de 2009 no site Whiplash.</p>\r\n<p align="justify">\r\n	O Whiplash, o maior site de Rock e Metal do Brasil, est&aacute; promovendo a segunda fase das elei&ccedil;&otilde;es para os Melhores de 2009. Marcelo Barbosa concorre na categoria Melhor Guitarrista, depois de passar pela primeira fase das elei&ccedil;&otilde;es, estando entre os dez mais votados.</p>\r\n<p align="justify">\r\n	Contamos com a ajuda de todos voc&ecirc;s votando em Marcelo Barbosa e Almah nas categorias relacionadas a tais artistas.</p>\r\n<p align="justify">\r\n	<strong>Aten&ccedil;&atilde;o:</strong> &Eacute; necess&aacute;ria a confirma&ccedil;&atilde;o dos votos por email.</p>\r\n<p align="justify">\r\n	Clique <a href="http://whiplash.net/pesquisas/votar_melhores_2009_fase_2.html">aqui</a> e participe da vota&ccedil;&atilde;o</p>\r\n', NULL, NULL, '2010-02-24 11:19:55', '2010-02-25 07:47:57', NULL),
